import React from 'react';
import './Users.css'
export default function Users(props) {
    return (
        <div className='usersSideBar'>
            {
                props.data.map((user) => {
                    return (
                        <div key={user.id} className='user'>
                            <p>{user.username}</p>
                        </div>
                    )
                })
            }
        </div>
    )
}
